import React, { Component } from 'react'
import compose from 'recompose'



class TodosShowBase extends Component {
    constructor(props) {
        super(props)
    }

    getTodos = async uid => {
        let todos = await this.props.firebase.doGetTodos(uid)
        return todos
    }

    render() {
        return(
            <div>
                {console.log(this.getTodos(this.props.uid))}
                <p>Здесь будут выводиться все данные из базы данных</p>
                <textarea></textarea>
            </div>
        )
    }

}

const TodosShow = compose(withFirebase)(TodoSBase)

export default TodosShow
